package collection;

import java.util.TreeSet;

public class ExemploTree {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeSet<String> cidade = new TreeSet<>();	
		cidade.add("Porto Alegre");
		cidade.add("Florianópolis");
		cidade.add("Curitiba");
		cidade.add("Recife");
		cidade.add("Garanhuns");
		System.out.println(cidade); //Retorna os Elementos por ordem alfabetica
		
		
	}

}
